import React, { Component } from "react";
import "./Login.css";

export default class Login extends Component {
  render() {
    return (
      <div className="background-login">
        <div className="login">
            <fieldset>
                <legend>Preencha os dados para Login</legend>
                <legend className='datas-to-login'>Email</legend>
                <input  placeholder='Digite aqui seu email' type="text"/>
                <legend className='datas-to-login'>Senha</legend>
                <input placeholder='Digite aqui sua senha' type="password"/>
                <a href="">Fazer Login</a>
            </fieldset>
        </div>
      </div>
    );
  }
}
